import React, {Component} from "react";

class App extends Component{
  // eslint-disable-next-line no-useless-constructor
  constructor(props) {
    super(props);
  }

  render() {

    return(
        <div className='wrapper'>
            <header>
                <svg />
                <div></div>
              <h3></h3>
            </header>
        </div>
    )
  }
}

export default App;
